import React, { useState } from 'react';

export const ListeDemande = () => {

    const [items, setItems] = useState();

    useEffect(() => {
        fetch('http://localhost:8080/vehicules',{ 
            method: "GET"
        }).then((response)=>response.json()).then((json)=>setItems(json.data));
      },[]);  

  return (
    <h1>Liste demande en cours</h1>
  );
}

export default ListeDemande;
